import React, {useEffect, useState} from "react";
import { Link } from "react-router-dom";
import axios from "axios";

function TypeList(){

    const [typeData, setTypeData] = useState([]);
    useEffect( ()=>{
        const getTypeList = async()=>{
            var res = await axios.get("http://localhost:8080/tipos");
            if (res?.data) {
                setTypeData(res.data);
            }
        }
        getTypeList();

    },[]);

    return(
        <React.Fragment>
            <div className="container">
                <h5>Tipos de produtos</h5>

                <Link to="/addtype" className="btn btn-success">Novo tipo</Link>
                <table className="table">
                    <thead>
                        <tr>
                            <th scope="col">#</th>
                            <th scope="col">Nome</th>
                            <th scope="col">Imposto</th>
                            <th scope="col">Ação</th>
                        </tr>
                    </thead>
                    <tbody>
                        {
                            typeData && typeData.map && typeData.map((tData, index)=>{
                                return (
                                <tr>
                                    <th>{tData.id}</th>
                                    <td>{tData.nome}</td>
                                    <td>{tData.imposto}</td>
                                    <td>
                                        <Link to={"/edittype/"+tData.id} className="btn btn-success">Editar</Link>
                                        <Link to={"/deletetype/"+tData.id} className="btn btn-danger">Deletar</Link>
                                    </td>
                                </tr>
                                );
                            })
                        }

                    </tbody>
                </table>

            </div>
        </React.Fragment>
    );
}

export default TypeList;
